	return (
		<Wrapper>
			<Content>
				<UserInfoContainer> <User> </User></UserInfoContainer>
				<PaymentContainer>HEJPAYMENT CONTAINER</PaymentContainer>	
				<PaymentContainer>HEJPAYMENT CONTAINER</PaymentContainer>				

			</Content>
		</Wrapper>
	);
}

export default Account
